import React from "react";

function HomeDash() {
  return (
    <div className="flex min-h-screen font-monts">
      <div className="bg-red-400 w-[15%] pt-5">
        <div className="flex ml-8 flex-col gap-9">
          <div className="flex items-center gap-3">
            <img classname="w-10" src="/images/friends.svg" alt="" />
            <p className="text-2xl font-semibold">Friends</p>
          </div>
          <div className="flex items-center gap-3">
            <img className="relative w-10" src="https://ausinterline.com/wp-content/uploads/2016/10/dummy-user-img.png" alt="" />
            <p className="text-xl font-bold">Rishabh sharma</p>
          </div>
        </div>
      </div>
      <div className="bg-parent-400 w-[50%]">chat</div>
      <div className="bg-green-400 w-[30%]">activenow</div>
    </div>
  );
}

export default HomeDash;
